    false,nt"url": null,nt"notes": "All open sanitation code complaints made
    to 311 and all requests completed since January 1, 2011. The Department of Streets
    and Sanitation investigates and remedies reported violations of Chicagou2019s sanitation
    code. Residents may request service for violations such as overflowing dumpsters
    and garbage in the alley.rn311 sometimes receives duplicate sanitation code complaints.
    Requests that have been labeled as duplicates are in the same geographic area as
    a previous request and have been entered into 311u2019s Customer Service Request
    (CSR) system at around the same time. Duplicate complaints are labeled as such in
    the status field, as either "Open - Dup" or "Completed - Dup."rnData Owner:
    Streets and Sanitation (http://www.cityofchicago.org/content/city/en/depts/streets.html).rnTime
    Period: January 1, 2011 to present.rnFrequency: Data is updated daily.rnRelated
    Applications: 311 Service Request Status Inquiry (https://servicerequest.cityofchicago.org/web_intake_chic/Controller?op=createsrquery2)
